package org.jn.core.java.student.afan.relationaloperator;

public class Output1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
			int a=20;int b=30;
			System.out.println("a > b " +(a>b));
			System.out.println("a >= b " +(a>=b));
			System.out.println("a <=b " +(a<=b));
			System.out.println("a < b " +(a<b));
			System.out.println("a == b " +(a==b));
			System.out.println("a != b " +(a!=b));
	}
}
